import React from 'react'
import "./Meme.css"
const Meme = ({meme}) => {
    return (
        <div className="meme">
            <div className="image">
                 <img src={meme.url} alt=""/>
            </div>
            {
                [...Array(meme.box_count)].map((el,index)=>(
                    <input type="text" key={index} placeholder={`Meme Caption ${index+1}`}/>
                ))
            }
        </div>
    )
}

export default Meme
